// Extrair parâmetros do MIME type: audio/L16;codec=pcm;rate=24000
const sampleRate = 24000; // extraído do rate=24000
const numChannels = 1;    // mono (padrão para L16)
const bitsPerSample = 16; // L16 = 16 bits

// Converter Base64 para Buffer
const pcmBuffer = Buffer.from(base64Data, 'base64');

// Criar header WAV
const wavHeader = createWavHeader(sampleRate, numChannels, bitsPerSample, pcmBuffer.length);

// Combinar header + dados PCM
const wavBuffer = Buffer.concat([wavHeader, pcmBuffer]);

// Converter para Base64 para output
const wavBase64 = wavBuffer.toString('base64');

// Retornar dados WAV prontos para uso
return [{
