    format: 'WAV',
    mimeType: 'audio/wav',
    audioData: wavBase64,
    originalFormat: 'PCM L16',
    sampleRate: sampleRate,
    channels: numChannels,
    bitsPerSample: bitsPerSample,
    size: wavBuffer.length
  }
}];
